#include <iostream>
#include <string>
using namespace std;

class List
{
public:
	List();

	void pop_front();
	void push_front(int data);
	void vstavit(int data, int index);
	int GetSize() { return size; }
	//доступ к эл, & т.к нужна возможность изменять тот эл, index номер изменяемого эл
	int& operator[](const int index);
private:
	//что бы решить проблему типов переменных, которая возникла в задании со стеком
	//можно использовать шаблон класса, который позволяет задать внутри класса объекты, тип которых на этапе написания кода неизвестен
	class Node {
	public://доступ из приватной секции класса лист
		Node* next;
		int data;
		//для создания пустого списка Tip(), при этом не засоряя его мусором, nullptr значение по умолчанию
		Node(int data = int(), Node *next = nullptr) {
			this->data = data;
			this->next = next;
		}
	};
	int size;//колл переменных
	//для создания обьекта с непривязанным типом данных нужно обьявить класс List шаблонным, * т.к. все эл будут хран в динам памяти
	Node *head;
};

List::List()
{
	size = 0;
	head = nullptr;
}

void List::pop_front()
{
	Node *temp = head;
	head = head->next;
	delete temp;
	size--;
}


void List::push_front(int data)
{
	head = new Node(data, head);
	size++;
}

void List::vstavit(int data, int index)
{
	
	if (index == 0) { push_front(data); }
	else {
		Node* pred = this->head;
		//найти предшествующий эл, после которого произойдет вставка
		for (int i(0); i < index - 1; i++) {
			pred = pred->next;
		}
		//новый эл становиться предыд для того который идет после него
		Node* newNod = new Node(data, pred->next);
		pred->next = newNod;
		size++;
	}
}

int& List::operator[](const int index)
{
	int count(0);
	Node* current = this->head;
	while (current != nullptr) {
		if (count == index) {
			cout<< current << endl;
			cout << current->next << endl;

			return current->data;
		}
		current = current->next;
		count++;
	}
}

int main()
{
	setlocale(LC_ALL, "Russian");
	List lst;
	cout << "Введите кол-во эл в списке: ";
	int nums;
	cin >> nums;
	cout << endl;
	for (int i(0); i < nums; i++) {
		lst.push_front(rand() % 50);
	}

	for (int i(0); i < lst.GetSize(); i++) {
		cout << lst[i] << endl;
	}
	
	lst.push_front(2);

	cout << "\nОтредактированный список: ";
	cout << endl;
	for (int i(0); i < lst.GetSize(); i++) {
		cout << lst[i] << endl;
	}
    return 0;
}

#include <iostream>
#include <string>
using namespace std;

class List
{
public:
	List();

	void pop_front();
	void removeAt(int index);
	void push_front(int data);
	void vstavit(int data, int index);
	int GetSize() { return size; }
	//доступ к эл, & т.к нужна возможность изменять тот эл, index номер изменяемого эл
	int& operator[](const int index);
private:
	//что бы решить проблему типов переменных, которая возникла в задании со стеком
	//можно использовать шаблон класса, который позволяет задать внутри класса объекты, тип которых на этапе написания кода неизвестен
	class Node {
	public://доступ из приватной секции класса лист
		Node* next;
		int data;
		//для создания пустого списка Tip(), при этом не засоряя его мусором, nullptr значение по умолчанию
		Node(int data = int(), Node* next = nullptr) {
			this->data = data;
			if (next == nullptr) {
				this->next = this;
			}
			else if ((next != nullptr) && (next->next == next)) {
				next->next = this;
				this->next = next;

			}
			else {

				this->next = next;
				Node* Tmp = next;
				while (Tmp->next != next) {
					Tmp = Tmp->next;
				}
				Tmp->next = this;
				this->next = next;
			}
		}
	};
	int size;//колл переменных
	//для создания обьекта с непривязанным типом данных нужно обьявить класс List шаблонным, * т.к. все эл будут хран в динам памяти
	Node* head;
};

List::List()
{
	size = 0;
	head = nullptr;
}


void List::pop_front()
{
	Node* temp = head;
	Node* Tmp = head;
	while (Tmp->next == head)
	{
		Tmp = Tmp->next;
	}
	head = head->next;
	Tmp->next = head;
	delete temp;
	size--;
}

void List::push_front(int data)
{
	head = new Node(data, head);
	size++;
}

void List::vstavit(int data, int index)
{

	if (index == 0) { push_front(data); }
	else {
		Node* pred = this->head;
		//найти предшествующий эл, после которого произойдет вставка
		for (int i(0); i < index - 1; i++) {
			pred = pred->next;
		}
		//новый эл становиться предыд для того который идет после него
		Node* newNod = new Node(data, pred->next);
		pred->next = newNod;
		size++;
	}
}

void List::removeAt(int index)
{
	if (index == 0) { pop_front(); }
	else {
		Node* pred = this->head;
		//найти предшествующий эл, после которого произойдет del
		for (int i(0); i < index - 1; i++) {
			pred = pred->next;
		}
		Node* Dell = pred->next;
		pred->next = Dell->next;
		delete Dell;
		size--;
	}
}

int& List::operator[](const int index)
{
	int count(0);
	Node* current = this->head;
	while (current != nullptr) {
		if (count == index) {
			cout << current << endl;
			cout << current->next << endl;

			return current->data;
		}
		current = current->next;
		count++;
	}
}

int main()
{
	cout << "zadazcha 9" << endl;
	List lst;

	int nums;
	cin >> nums;
	for (int i(0); i < nums; i++) {
		lst.push_front(rand() % 50);
	}

	for (int i(0); i < lst.GetSize(); i++) {
		cout << lst[i] << endl;
	}

	for (int i(0); i < lst.GetSize(); i++) {
		if (i != NULL) {
			lst.removeAt(i);
		}
	}
	for (int i(0); i < lst.GetSize(); i++) {
		cout << lst[i]
			<< endl;
	}
	cout << "zadacha 13" << endl;
	List osn;
	List sost2;
	for (int i(1); i < 21; i++) {
		osn.push_front(i);
	}
	for (int i(0); i < osn.GetSize(); i++) {
		cout << osn[i] << endl;
	}
	int c = 0;
	for (int i(0); i < osn.GetSize(); i++) {
		if (i != NULL) {
			sost2.vstavit(osn[i], c);
			osn.removeAt(i);
			c++;
		}
	}
	cout << " " << endl;
	cout << "1 komanda" << endl;
	for (int i(0); i < osn.GetSize(); i++) {
		cout << osn[i] << endl;
	}
	cout << " " << endl;
	cout << "2 komanda" << endl;
	for (int i(0); i < sost2.GetSize(); i++) {
		cout << sost2[i] << endl;
	}
	return 0;
}

