class Trip {
public:
    Trip(HotelProvider& hp, FlightProvider& fp)
        : hp_(hp)
        , fp_(fp) {
    }

    Trip(const Trip& other)
        : hp_(other.hp_)
        , fp_(other.fp_) {
    }

    Trip(Trip&& other) noexcept
        : hp_(other.hp_)
        , fp_(other.fp_) {
    }
        
    Trip& operator=(const Trip& other) {
        hp_ = other.hp_;
        fp_ = other.fp_;
        flights = other.flights;
        hotels = other.hotels;
        return *this;
    }
    Trip& operator=(Trip&& other) noexcept{
        hp_ = other.hp_;
        fp_ = other.fp_;
        flights = other.flights;
        hotels = other.hotels;
        return *this;
    }
    void Cancel() {
        for (const auto& flight : flights) {
            fp_.Cancel(flight);
        }
        for (const auto& hotel : hotels) {
            hp_.Cancel(hotel);
        }
    };
    ~Trip() {
        Cancel();
    };

    std::vector<int> flights;
    std::vector<int> hotels;

private:
    HotelProvider& hp_;
    FlightProvider& fp_;
};

class TripManager {
public:
    using BookingId = std::string;
    struct BookingData {
        std::string city_from;
        std::string city_to;
        std::string date_from;
        std::string date_to;
    };

    Trip Book(const BookingData& data) {
        Trip trip(hotel_provider_, flight_provider_);
        {
            FlightProvider::BookingData flight_booking_data{data.city_from, data.city_to, data.date_from};
            trip.flights.push_back(flight_provider_.Book(flight_booking_data));
        }
        {
            HotelProvider::BookingData hotel_booking_data{ data.city_to, data.date_from, data.date_to };
            trip.hotels.push_back(hotel_provider_.Book(hotel_booking_data));
        }
        {
            FlightProvider::BookingData flight_booking_data{ data.city_to, data.city_from, data.date_to };
            trip.flights.push_back(flight_provider_.Book(flight_booking_data));
        }
        return trip;
    }

    void Cancel(Trip& trip) {
        trip.Cancel();
    }

private:
    HotelProvider hotel_provider_;
    FlightProvider flight_provider_;
};

#define _CRT_SECURE_NO_WARNINGS

#include <iostream>
#include <cstring>


using namespace std;

class String {

public:

	String() : size(0), capacity(15), str(new char[15]) {
		total_number_strings++;
	}

	String(const int string_capacity) : size(0), capacity(string_capacity), str(new char[string_capacity]) {
		total_number_strings++;
	}

	String(const char new_str[]) {
		capacity = strlen(new_str) + 1;
		str = new char[capacity];
		strcpy(str, new_str);
		size = capacity - 1;
		total_number_strings++;
	}

	String(const String& other) : size(other.size), capacity(other.capacity), str(new char[capacity]) {
		strcpy(str, other.str);
		total_number_strings++;
	}

	String& operator=(const String& other) {
		if (&other != this) {
			size = other.size;
			capacity = other.capacity;
			delete[] str;
			str = new char[capacity];
			strcpy(str, other.str);
		}
		return *this;
	} // перегрузка оператора присваивания =



	String(String&& other) : size(other.size), capacity(other.capacity), str(other.str) {
		other.str = nullptr;
		other.size = 0;
		other.capacity = 0;
		total_number_strings++;
	}

	String& operator=(String&& other) {
		if (&other != this) {
			size = other.size;
			capacity = other.capacity;
			delete[] str;
			str = other.str;
			other.str = nullptr;
			other.size = 0;
			other.capacity = 0;
		}
		return *this;
	} // перегрузка оператора присваивания =


	char& operator[] (const int index) {
		if (index < 0 || index >= size) {
			cout << "Invalid index" << endl;
			abort;
		}
		return str[index];
	} // перегрузка оператора индексирования (сеттер)

	char operator[] (const int index) const {
		if (index < 0 || index >= size) {
			cout << "Invalid index" << endl;
			abort;
		}
		return str[index];
	} // перегрузка оператора индексирования для константных объектов

	bool operator==(const String& right) const {
		if (right.size != size) {
			return false;
		}
		for (int i = 0; i < size; i++) {
			if (str[i] != right.str[i])
				return false;
		}
		return true;
	}

	bool operator!=(const String& right) const {
		return !(*this == right);
	}

	int Size() const {
		return size;
	}

	int Capacity() const {
		return capacity;
	}

	static int GetTotalNumberStrings() {
		return total_number_strings;
	}

	~String() {
		delete[] str;
		total_number_strings--;
	}

private:
	int size;
	int capacity;
	char* str;
	static int total_number_strings;
};

ostream& operator<<(ostream& output, const String& string) {
	for (int i = 0; i < string.Size(); i++) {
		output << string[i];
	}
	return output;
} // перегрузка оператора вывода в поток <<

istream& operator>>(istream& input, String& string) {
	int capacity = 15;
	int i = 0;
	char* str = new char[capacity];
	char ch;
	while (ch = input.get()) {
		if (ch == ' ' || ch == '\n') {
			break;
		}
		if (i == capacity - 1) {
			char* temp = new char[capacity *= 2];
			for (int j = 0; j <= i; j++) {
				temp[j] = str[j];
			}
			delete[] str;
			str = temp;
		}
		str[i] = ch;
		i++;
	}
	if (i > 0) {
		str[i] = '\0';
		string = move(String(str));
	}
	return input;
} // перегрузка оператора ввода из потока >>

int String::total_number_strings = 0;


int main() {
	String my_string;
	cout << "Size: " << my_string.Size() << " Capacity: " << my_string.Capacity() << endl;
	my_string = "Hello";
	cout << my_string << endl;
	cout << "Size: " << my_string.Size() << " Capacity: " << my_string.Capacity() << endl;
	my_string = "Hello my dear friend";
	cout << my_string << endl;
	cout << "Size: " << my_string.Size() << " Capacity: " << my_string.Capacity() << endl;
	my_string[2] = 'm';
	cout << my_string << endl;
	cout << my_string[1] << endl;
	String my_string2("1234");
	cout << my_string2 << endl;
	cout << "Size: " << my_string2.Size() << " Capacity: " << my_string2.Capacity() << endl;
	const String my_string3(my_string);
	cout << my_string3[1] << endl;
	cout << my_string3 << endl;
	cout << String::GetTotalNumberStrings() << endl;
	cout << (my_string == my_string2) << endl;
	cout << (my_string != my_string2) << endl;
	String my_string4;
	my_string4 = my_string;
	cout << my_string4 << endl;
	my_string4 = "Hello";
	cout << my_string4 << endl;
	String my_string5;
	cin >> my_string5;
	cout << my_string5 << endl;


	String my_string6(move(my_string4));
	cout << my_string6 << endl;
	cout << my_string4 << "clear" << endl;

	my_string4 = move(my_string);
	cout << my_string4 << endl;
	cout << my_string << "clear" << endl;


}

$(function() {
  // Tus tags predefinidos, cada tag va entre corchetes y debe tener los valores declarados en el ejemplo
  var threadTags = [
    {
      filter: 'privado', // Valor que buscará, ponlo siempre todo en minúsculas, obligatorio
      color: '#3774ad', // Color de acento, obligatorio
      icon: '<em class="fas fa-times"></em>' // Icono, si no necesitas, déjalo como en el ejemplo de 'libre'
    },
    {
      filter: '+18',
      color: '#ad3737',
      icon: '<em class="fas fa-exclamation-triangle"></em>'
    },
    {
      filter: 'libre',
      color: '#37ad3f',
      icon:''
    }
  ];
  var threadTagClass = 'threadtag'; // Título de la clase de tus tags
  var threadTagElement = 'span'; // Elemento que serán tus tags (div, span, i, etc)
  var undeclaredTagColor = '#655670'; // Color de acento para los tags no predefinidos
  var lastPostLink = '.forums .row .lastpost>span>a:first-child'; // Link del último tema en el listado de foros

  // NO EDITES A PARTIR DE AQUÍ
  // EN SERIO, SI EDITAS Y LO ROMPES ES COSA TUYA
  
  $('.module-title, .post-title, .title-thread, a.topictitle').each(function() {
    var tagsFound = []; // Array para guardar etiquetas encontradas
    var $element = $(this); // Guardar elemento seleccionado

    var titleOnly = '';
    var string = $element.text();
    if (/\{.*?\}/.test(string)) {
      titleOnly = string.replace(/\{.*?\}/g, "").trim();
    } else {
      titleOnly = string.trim();
    }
    var tags = string.toLowerCase().match(/[^{]+(?=\})/g);

    if (tags) {
      $.each(tags, function(index, tag) {
        var foundTag = false; // Valor para checar si el tag ha sido encontrado en threadTags
        $.each(threadTags, function(index, threadTag) {
          if (tag === threadTag.filter) {
            // El valor de la etiqueta coincide con un filtro de threadTags
            tagsFound.push('<'+threadTagElement+' class="'+threadTagClass+'" data-filter="' + threadTag.filter + '" style="--accent:' + threadTag.color + '">' + threadTag.icon + '' + threadTag.filter + '</'+threadTagElement+'>'); // Añade el tag encontrado al array
            foundTag = true;
          }
        });

        if (!foundTag) {
          tagsFound.push('<'+threadTagElement+' class="'+threadTagClass+'" data-filter="' + tag + '" style="--accent:' + undeclaredTagColor + '">' + tag + '</'+threadTagElement+'>'); // Añade el tag no predefinido al array
        }
      });
    }

    var tagsString = tagsFound.join(''); // Formar string con los tags encontrados
    if (tagsString.length > 0) {
      var titleAndTags = tagsString + titleOnly;
      $element.html(titleAndTags);
    }
    if ($element.hasClass('title-thread')) {
      $('title').text(titleOnly); // Cambiar valor de title si se está previsualizando un tema con tags
    }
  });

  // Limpiar links en últimos posts de foros
  $(lastPostLink).each(function() {
    var $element = $(this);
    var string = $element.attr('title');
    if (/\{.*?\}/.test(string)) {
      string = string.replace(/\{.*?\}/g, "").trim();
      $element.text(string).attr('title',string);
    }
  });

  // Insertar formulario en creación de temas
  $('form[action="/post"]').find('.threadSubject').each(function() {
    var $threadSubject = $(this);
    var subjectText = $threadSubject.text().trim();
    if (subjectText.indexOf('tema') !== -1) {
      var formHTML = '<form id="tagForm"><div>'; // Insertar formulario
      $.each(threadTags, function(index, threadTag) {
        var idTag = threadTag.filter.replace(/\s/g, '');
        var checkboxHTML = '<input type="checkbox" name="tags" id="tag-'+idTag+'" value="' + threadTag.filter + '"><label for="tag-'+idTag+'"><'+threadTagElement+' class="'+threadTagClass+'" data-filter="' + threadTag.filter + '" style="--accent:' + threadTag.color + '">' + threadTag.icon + '' + threadTag.filter + '</'+threadTagElement+'></label>';
        formHTML += checkboxHTML; // Añadir tags al HTML del formulario
      });
      formHTML += '</div><br/><button id="addTagsBtn">Modificar título de tema</button></form>'; // Insertar botón al formulario

      $threadSubject.parents('fieldset').before(formHTML); // Colocar el formulario sobre la edición de título de tema

      // Marcar como checks los inputs presentes en el título al cargar la página
      var threadSubjectInput = $threadSubject.parents('dl').find('dd input[name="subject"]');
      var inputValue = threadSubjectInput.val();

      threadTags.forEach(function(tag) {
        if (inputValue.toLowerCase().includes(tag.filter.toLowerCase())) {
          $('#tagForm').find('input[name="tags"][value="' + tag.filter + '"]').prop('checked', true);
        }
      });
    }
  });

  // Botón de añadir tags
  $('#addTagsBtn').click(function() {
    var selectedTags = $(this).prev().prev().find('input[name="tags"]:checked')
      .map(function() {
        return '{' + $(this).val() + '}';
      })
      .get();

    var threadSubjectInput = $(this).parents('form').next('fieldset').find('.threadSubject').parents('dl').find('dd input[name="subject"]');
    var inputValue = threadSubjectInput.val();
    var existingTags = inputValue.match(/\{.*?\}/g) || [];

    // Quitar los tags deseleccionados
    var deselectedTags = existingTags.filter(function(tag) {
      var tagFilter = tag.substring(1, tag.length - 1).toLowerCase();
      return !selectedTags.includes(tag) && threadTags.some(function(threadTag) {
        return threadTag.filter.toLowerCase() === tagFilter;
      });
    });
    deselectedTags = deselectedTags.filter(function(tag, index) {
      return deselectedTags.indexOf(tag) === index;
    });
    var updatedTags = existingTags.filter(function(tag) {
      return !deselectedTags.includes(tag);
    });

    // Añadir tags seleccionados no presentes
    selectedTags.forEach(function(tag) {
      if (!updatedTags.includes(tag)) {
        updatedTags.push(tag);
      }
    });

    // Actualizar título
    var updatedSubject = updatedTags.join('') + ' ' + inputValue.replace(/\{.*?\}/g, '').trim();
    threadSubjectInput.val(updatedSubject.trim());
    return false;
  });
});

#include <iostream>

using namespace std;

class SimpleVector {

public:

	SimpleVector() : arr_(new int[10]), size_(10) {
		cout << "SimpleVector constructed for " << size_ << " elements, for " << this << endl;
	}

	SimpleVector(int size) : arr_(new int[size]), size_(size) {
		cout << "SimpleVector constructed for " << size_ << " elements, for " << this << endl;
	}

	SimpleVector(const SimpleVector& object) : arr_(new int[object.size_]), size_(object.size_) {
		for (int i = 0; i < size_; i++) {
			arr_[i] = object.arr_[i];
		};
		cout << "SimpleVector copy constructed for " << size_ << " elements, for " << this << endl;
	}

	SimpleVector& operator=(const SimpleVector& object) {
		if (!(this == &object)) {
			delete[] arr_;
			arr_ = new int[object.size_];
			size_ = object.size_;
			for (int i = 0; i < size_; i++) {
				arr_[i] = object.arr_[i];
			}
		}

		cout << "SimpleVector copy operator = for " << size_ << " elements, for " << this << endl;
		return *this;
	}

	SimpleVector(SimpleVector&& object) : arr_(object.arr_), size_(object.size_) {
		object.arr_ = nullptr;
		object.size_ = 0;
		cout << "SimpleVector move constructed for " << size_ << " elements, for " << this << endl;
	}

	SimpleVector& operator=(SimpleVector&& object) {
		if (!(this == &object)) {
			delete[] arr_;
			arr_ = object.arr_;
			size_ = object.size_;
			object.arr_ = nullptr;
			object.size_ = 0;
		}

		cout << "SimpleVector move operator = for " << size_ << " elements, for " << this << endl;
		return *this;
	}

	void print() const {
		for (int i = 0; i < 10; i++) {
			cout << arr_[i] << ' ';
		}
		cout << endl;
	}

	int& operator[] (int index) {
		if (index >= 0 && index < size_) {
			return arr_[index];
		}
	}

	~SimpleVector() {
		delete[] arr_;
		cout << "SimpleVector destructed for " << size_ << " elements, for " << this << endl;;
	}

private:
	int* arr_;
	int size_;
};


SimpleVector VectorFactory(int arrSize, int starting_point) {
	srand(starting_point);
	SimpleVector vec(arrSize);
	for (int i = 0; i < arrSize; i++) {
		vec[i] = rand() % 10;
	}
	return vec;
}

int main() {
	SimpleVector arr[10]{}; // результирующая выборка
	int index = 0;
	for (int i = 0; i < 10; i++) {
		cout << endl << endl;
		SimpleVector vec;
		vec = VectorFactory(1000000, i); // считываем, парсим откуда-то большой объем информации
		vec.print(); // как-то его обрабатываем
		// здесь могут быть какие-то еще функции для обработки
		if (vec[0] % 2 == 0) { // если в итоге он удовлетворяет определенным условиям
			arr[index] = move(vec); // записываем его в результирующую выборку
			index++;
		}
	}
	cout << endl << endl;
	for (int i = 0; i < index; i++) { // выводим результат
		arr[i].print();
	}
}

